import React from 'react';
import './App.css';

function getTime() {
	return new Date().toLocaleTimeString();
}

setInterval(() => {
	App();
}, 1000);

function App() {
	return (
		<div className="App">
			<h1>First react app.{getTime()}</h1>
		</div>
	);
}

export default App;
